import React from "react";
import { Link } from "react-router-dom";
import projects from "../projects";
function scroll() {
  // var imagebox = document.getElementById("imagebox");
  // imagebox.scrollTop = 0;
  console.log("hajj");
}
let liClasses = {
  "main-class": true,
  activeClass: true
};

class Projects extends React.Component {
  state = {
    projects: projects
  };

  render() {
    const myProjects = this.state.projects;
    return (
      <div className="mobile">
        <div>
          {myProjects.map(eachProject => {
            return (
              <div className="mobtitlebox" key={eachProject.id}>
                <div
                  onClick={scroll}
                  className="mobiletitle"
                  to={`/projects/${eachProject.id}`}
                >
                  <img class="mobileHero" src={eachProject.image[0]} />
                  {eachProject.name}
                </div>

                <hr />
              </div>
            );
          })}
        </div>
      </div>
    );
  }
}

export default Projects;
